    "2014-07-15T13:00:37.762886",nt"name": "gridded-observed-meteorological-data-1949-2010",nt"isopen":
    false,nt"url": null,nt"notes": "These daily gridded observations at 1/8
    degree spatial resolution (about 12 km) are a baseline dataset to be compered to
    downscaled climate predictions. The grid used is the same as has been used by other
    1/8th degree spatial resolution downscaling projects. The updated data were processed
    exactly as in the reference above with the single exception of the precipitation
    time-of-observation adjustment. For this updated dataset, if a meteorological station
    has a time of observation before noon, the precipitation is assigned to the prior
    day, otherwise no adjustment is made. Before using this dataset, please review the
    materials here: https://my.usgs.gov/confluence/display/GeoDataPortal/2014/04/16/Notice%3A+Evaluation+of+Maurer+gridded+observational+datasets+and+their+impacts+on+downscaled+products",nt"license_title":
